%[text] # example for importance sampling of SRP (Ashikhmin–Shirley model)
%[text] モンテカルロ積分に使う乱数の数は `nMCint`
%[text] `それを nMC` 回行って平均と分散を計算し，plotする．（ややこしい）
clc
clear
cls

format long
%[text] ## Monte-Carlo condition & pre-allocation
nMC = 2;

srpTrue = zeros(nMC, 3);
srpImp = zeros(nMC, 3);

%[text] ## object
sat = readSC('flatPlate.obj', 1) %[output:0a30a25f] %[output:9a4612b9] %[output:7b3cb81e] %[output:7ee9e033]
showSC(sat, 'Normal', 'on'); %[output:52784536]
sat.rho = 0.5;
sat.F0 = 0.5;
sat.nu = 800;
sat.nv = 150;

const = orbitConst;
d = au2km(1, const) * 10^3; % m
dAU = km2AU(d ./ 10^3, const); % AU
S0 = const.S0; % Solar constant, W/m^2
c = const.c; % light speed, m/s
coeff = -S0 / c / dAU^2;
%[text] ## Ashikhmin–Shirley model
thetaI = deg2rad(20);
phiI = deg2rad(48);
sunB = [sin(thetaI)*cos(phiI), sin(thetaI)*sin(phiI), cos(thetaI)];
sunB = sunB ./ norm(sunB);

% Monte-Carlo integration condition
nMCintUni = [1000, 5000, 10000, 50000, 100000, 10^6];
nMCintUni = [100000 10^6];

tic
for i = 1:length(nMCintUni)
    N = nMCintUni(i);
    for j = 1:nMC
%[text] ## speuclar only, uniform distribution
        [~, ~, srpCs] = srpASuni(sat, sunB, d, const, N);

        srpTrue(j,:) = srpCs;
    end
    stdTrue(i,:) = std(srpTrue);
    meanTrue(i,:) = mean(srpTrue);
end
toc %[output:8a40cc70]
%[text] ## importance sampling
% Monte-Carlo integration condition
% nMCint = 10:200:10000;
nMCintImp = [100 10^4];
nMCintImp = nMCintUni;

tic
for i = 1:length(nMCintImp)
    N = nMCintImp(i);
    for j = 1:nMC
        [~, ~, srpCs] = srpAS(sat, sunB, d, const, N);   
        srpImp(j,:) = srpCs;
    end

    stdImp(i,:) = std(srpImp);
    meanImp(i,:) = mean(srpImp);
end

toc %[output:8fa00d7e]

%[text] ## show Figs
figure %[output:8c6d2dd8]
tiledlayout(3,1), nexttile %[output:8c6d2dd8]
plotStd(nMCintUni, meanTrue(:,1), 3*stdTrue(:,1), 'r'), hold on %[output:8c6d2dd8]
plotStd(nMCintImp, meanImp(:,1), 3*stdImp(:,1), 'b', 'b'); %[output:8c6d2dd8]

nexttile %[output:8c6d2dd8]
plotStd(nMCintUni, meanTrue(:,2), 3*stdTrue(:,2)); hold on %[output:8c6d2dd8]
plotStd(nMCintImp, meanImp(:,2), 3*stdImp(:,2),'b', 'b'); %[output:8c6d2dd8]

nexttile %[output:8c6d2dd8]
plotStd(nMCintUni, meanTrue(:,3), 3*stdTrue(:,3)); hold on %[output:8c6d2dd8]
plotStd(nMCintImp, meanImp(:,3), 3*stdImp(:,3), 'b', 'b'); %[output:8c6d2dd8]

[meanTrue(end,:) %[output:group:19edfd9f] %[output:0bfd3f35]
    meanImp(end,:)] %[output:group:19edfd9f] %[output:0bfd3f35]

